description.plain:
Jay Rock reflects upon the trials and tribulations that occurred before and after his near fatal motorcycle crash in 2016. Contributions from label mates SZA and Kendrick Lamar provide a soulful backing for Rock’s uplifting and introspective commentary.

Commenting on his accident, Jay Rock credited his religious faith for his recovery, stating;

“I was just doing what real dudes do. I was on my bike. Accidents happen…By God’s grace, he protected me the whole way.”

